-- these are sprites which will need to be accessed by multiple functions
claudius_sprite = nil;
captain = nil;
methus = nil;
knight1 = nil;
knight2 = nil;
muabi = nil;
-- TODO: add sprites for mak'oks

function Load(m)
	-- First, record the current map in the "map" variable that is global to this script
	map = m;
	map.run_forever = true;
	dialogue_supervisor = m.dialogue_supervisor;
	event_supervisor = m.event_supervisor;

	CreateDialogue();

	local sprite;
	local dialogue;
	local event;
	local chest;
	local text;

	-- Add Claudius, the protagonist
	claudius_sprite = ConstructSprite("Claudius", 1000, 85, 90);
	claudius_sprite:LoadAttackAnimations("img/sprites/map/claudius_attack.png");

	-- Add NPC Knight Captain
	captain = ConstructSprite("Captain", 1, 75, 85, 0.0, 0.0);

	-- Add NPC Sgt. Methus
	methus = ConstructSprite("Karlate", 2, 80, 80, 0.0, 0.0);
	methus:SetName(hoa_system.Translate("Methus"));

	-- Add NPC Knight #1
	knight1 = ConstructSprite("Karlate", 3, 85, 80, 0.0, 0.0);
	knight1:SetName(hoa_system.Translate("Knight"));

	-- Add NPC Knight #2
	knight2 = ConstructSprite("Karlate", 4, 80, 90, 0.0, 0.0);
	knight2:SetName(hoa_system.Translate("Narrator"));

	-- add Claudius and NPC's to map
	map:AddGroundObject(claudius_sprite);
	map:AddGroundObject(captain);
	map:AddGroundObject(methus);
	map:AddGroundObject(knight1);
	map:AddGroundObject(knight2);

	event = hoa_map.DialogueEvent(10001, 1);
	event_supervisor:RegisterEvent(event);

	event_supervisor:StartEvent(10001);

	-- Set the camera to focus on the player sprite
	map:SetCamera(claudius_sprite);
end -- function Load()


function Draw()
	map:DrawMapLayers();
end

function CreateDialogue()
	local dialogue;
	
	dialogue = hoa_map.MapDialogue(1);

		text = hoa_system.Translate("A Muabi tribe member stands in the distance, surveying a caravan of marching Harrvahn knights who are led by Mak’ok hounds. In the back of this caravan is Claudius. The knights continue marching single file until reaching their destination: the bank of the river. The Maubi member continues to watch from a distance.");
		dialogue:AddText(text, 4, 1, 0, false);		
		text = hoa_system.Translate("Open your ears and shut your mouths. Our mission is to unblock the water supply. Stay together and on guard, I don't want any heroes or fools dying on the surgeon's table tonight.");
		dialogue:AddText(text, 1, 2, 0, false);
		text = hoa_system.Translate("Some knights begin setting a perimeter around their location, while others scout the area. The spying Maubi disappears into the darkness. Claudius moves to help some of the knights scout.");
		dialogue:AddText(text, 4, 3, 0, false);
		text = hoa_system.Translate("Stay by the riverside Claudius, with the Mak’ok’s. You’re not a knight yet.");
		dialogue:AddText(text, 3, 4, 0, false);
		text = hoa_system.Translate("Claudius observes the knights work to establish their presence in the area. He sees as some of the knights approach the nearby cave where the water is coming from. Once the perimeter is secure the knights regroup where Claudius is, by the riverside.");
		dialogue:AddText(text, 4, 5, 0, false);
		text = hoa_system.Translate("The water is definitely blocked somewhere in the cave. You can normally hear it from here when it's running full force. There can't be more than a trickle moving toward the city.");
		dialogue:AddText(text, 2, 6, 0, false);
		text = hoa_system.Translate("All right. Draw your steel and prepare yourselves, we’re going in.");
		dialogue:AddText(text, 1, 7, 0, false);
		text = hoa_system.Translate("Claudius, who has been holding the leashes to the Mak’ok’s, drops them and draws his sword.");
		dialogue:AddText(text, 4, 8, 0, false);
		text = hoa_system.Translate("Claudius, this is your first mission and you’re still in training. Your job is to man the Makok’s and be observant of your superiors.");
		dialogue:AddText(text, 1, 9, 0, false);
		text = hoa_system.Translate("Yes, sir.");
		dialogue:AddText(text, 1000, 10, 0, false);
		text = hoa_system.Translate("Claudius sheaths his sword and picks up the leashes. The knights, along with Claudius, enter the cave.");
		dialogue:AddText(text, 4, -1, 0, false);

	dialogue_supervisor:AddDialogue(dialogue);
end
